const MyButton = ({ text, type, onClick }) => {
  return (
    <button
      className={["MyButton", `Mybutton_${type}`].join(" ")}
      onClick={onClick}
    >
      {text}
    </button>
  );
};

MyButton.defaultProps = {
  type: "default",
};

export default MyButton;
